import "./Project.css";

function Project(){

    return(
        <div className="projectPage">
            <div className="flexBox">
                <img className="imgBox" src={require('../images/me.jpg')}></img>
                <p>This is my face. It's a pretty face</p>
            </div>
        </div>
    )
}

export default Project;
